import React from 'react';
import { NavLink } from 'react-router-dom';

const Header = () => {
  return(
    <div id="header">
      <NavLink to="/dashboard" activeClassName="active"> Dashboard </NavLink>
      <NavLink to="/manage" activeClassName="active"> Items </NavLink>
    </div>
  )
}

export default Header;
